import React, { Component } from 'react';
import PropTypes from 'prop-types';
import WorksheetCard from './components/WorksheetCard';

// eslint-disable-next-line react/prefer-stateless-function
class FullView extends Component {



  mapWorksheets = () => {
    const { onDeleteWorksheet, onCloneWorksheet, worksheets } = this.props;
    return worksheets.map((worksheet, index) => (
      <WorksheetCard index={index} key={worksheet.id} worksheet={worksheet} onDeleteWorksheet={onDeleteWorksheet} onCloneWorksheet={onCloneWorksheet}/>
    )
  )
}

  render() {
    const { worksheets } = this.props;
    return (
      <div className="content-section">
        <div className="result-row center-align">
          <b className="result"> -   Results -</b>
        </div>
        <div className="row d-flex-content card-width-272">
          {this.mapWorksheets()}

        </div>
      </div>
    )
  }
}

FullView.propTypes = {
  onDeleteWorksheet: PropTypes.func.isRequired,
  onCloneWorksheet: PropTypes.func.isRequired,
  worksheets: PropTypes.array.isRequired,
}
export default FullView;
